import React from "react";

const Qualifications = () => {
  return (
    <div className="p-8 text-white bg-gradient-to-b from-[#010124] to-[#020238] min-h-screen">
      <h2 className="text-4xl font-bold text-indigo-400 mb-10 animate-pulse">
        My Qualifications and Experiences
      </h2>

      <ul className="space-y-10">
        <li className="shadow-lg p-6 bg-[#1e1e4a] rounded-2xl hover:scale-105 transition-all">
          <h4 className="text-2xl font-semibold text-[#8a7fd1] mb-2">
            Software Engineering Student - 3rd Year
          </h4>
          <a
            href="https://altinbas.edu.tr/"
            target="_blank"
            className="text-indigo-300 hover:underline">
            Altinbas University, Türkiye, Istanbul
          </a>
        </li>

        <li className="shadow-lg p-6 bg-[#1e1e4a] rounded-2xl hover:scale-105 transition-all">
          <h4 className="text-2xl font-semibold text-[#8a7fd1] mb-2">
            AI Prompt Engineer / AI Trainer
          </h4>
          <p className="text-gray-400 text-sm">
            Outlier Company
          </p>
          <ul className="mt-4 space-y-2 text-[#d0cfff] text-md">
            <li>● Prompt Creation: Designing prompts to generate optimal AI responses.</li>
            <li>● Response Evaluation: Assessing AI responses for quality and accuracy.</li>
          </ul>
          <a
            href="https://outlier.ai/"
            target="_blank"
            className="mt-4 inline-block text-indigo-300 hover:underline">
            Company Link
          </a>
        </li>

        <li className="shadow-lg p-6 bg-[#1e1e4a] rounded-2xl hover:scale-105 transition-all">
          <h4 className="text-2xl font-semibold text-[#8a7fd1] mb-2">
            English Teacher
          </h4>
          <p className="text-gray-400">
            Part-time English Teacher at English Time School, Istanbul.
          </p>
          <a
            href="https://www.englishtime.com/en"
            target="_blank"
            className="mt-4 inline-block text-indigo-300 hover:underline">
            English Time Website
          </a>
        </li>
      </ul>
    </div>
  );
};

export default Qualifications;
